class Node extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    if (this.props.hasChildren) {
      return (
        <div>
          <div className="page" contentEditable="true"></div>
          <div>child</div>
          <Node hasChildren={false} />
        </div>
      );
    } else {
      return (
        <div>
          <div className="page" contentEditable="true"></div>
        </div>
      );
    }
  }
}

export default Node;
